import React from 'react';

import { fetchLogout } from './services';

const Logout = ({ user, onLogout }) => {
  const logout = () => {
    fetchLogout()
    .then( () => onLogout() );
  };
  return (
    <ul className='logout'>
      { user.isLoggedIn &&
          <button className="logout-button" onClick={logout}>Logout</button> }
    </ul>
  );
};

export default Logout;
